import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { Calendar, MapPin, Share2, ArrowLeft } from 'lucide-react';

const EventDetails = ({ allEvents, theme, onRegister }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const event = allEvents.find(e => e.id === parseInt(id));
  const isDark = theme === 'dark';

  if (!event) return <div>Event not found</div>;

  const styles = {
    // Center content on desktop, full width on mobile
    container: {
      maxWidth: '1000px',
      margin: '0 auto',
      padding: '24px',
      fontFamily: 'sans-serif',
      color: isDark ? '#fff' : '#1e293b',
      paddingBottom: '100px' // Space for fixed button on mobile
    },
    headerNav: {
      display: 'flex', justifyContent: 'space-between', marginBottom: '20px'
    },
    iconBtn: {
      background: 'none', border: 'none', cursor: 'pointer',
      color: isDark ? '#fff' : '#1e293b'
    },
    
    // Grid for Desktop (Side-by-side)
    grid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
      gap: '30px',
      alignItems: 'start'
    },
    
    // Image Section
    image: {
      width: '100%',
      height: '300px',
      objectFit: 'cover',
      borderRadius: '20px',
      boxShadow: '0 4px 20px rgba(0,0,0,0.1)'
    },

    // Info Section
    infoCol: { display: 'flex', flexDirection: 'column', gap: '20px' },
    title: { fontSize: '28px', fontWeight: '800', lineHeight: '1.2' },
    
    // Icon Rows
    row: { display: 'flex', alignItems: 'center', gap: '15px' },
    iconBox: {
      width: '48px', height: '48px', borderRadius: '12px',
      backgroundColor: isDark ? '#334155' : '#eff6ff',
      color: '#3b82f6',
      display: 'flex', alignItems: 'center', justifyContent: 'center'
    },
    label: { fontSize: '12px', color: '#64748b', fontWeight: 'bold', display: 'block' },
    value: { fontSize: '16px', fontWeight: '600' },

    // Description
    descTitle: { fontSize: '18px', fontWeight: 'bold', marginBottom: '10px' },
    descText: { lineHeight: '1.6', color: '#64748b' },

    // Sticky Bottom Button (Mobile style, but centered on desktop)
    footer: {
      position: 'fixed',
      bottom: '20px',
      left: '50%',
      transform: 'translateX(-50%)',
      width: '90%',
      maxWidth: '400px', // Don't get too wide
      zIndex: 100
    },
    registerBtn: {
      width: '100%',
      padding: '16px',
      backgroundColor: '#3b82f6',
      color: '#fff',
      border: 'none',
      borderRadius: '16px',
      fontSize: '16px',
      fontWeight: 'bold',
      cursor: 'pointer',
      boxShadow: '0 4px 15px rgba(59, 130, 246, 0.4)'
    }
  };

  return (
    <div style={styles.container}>
      {/* Navigation */}
      <div style={styles.headerNav}>
        <button style={styles.iconBtn} onClick={() => navigate(-1)}><ArrowLeft size={24} /></button>
        <button style={styles.iconBtn}><Share2 size={24} /></button>
      </div>

      <div style={styles.grid}>
        {/* Left: Image */}
        <img src={event.image} alt={event.title} style={styles.image} />

        {/* Right: Details */}
        <div style={styles.infoCol}>
          <h1 style={styles.title}>{event.title}</h1>
          
          <div style={styles.row}>
            <div style={styles.iconBox}><Calendar size={24} /></div>
            <div><span style={styles.label}>Date & Time</span><span style={styles.value}>{event.date}</span></div>
          </div>

          <div style={styles.row}>
            <div style={styles.iconBox}><MapPin size={24} /></div>
            <div><span style={styles.label}>Location</span><span style={styles.value}>{event.location}</span></div>
          </div>

          <div>
            <h3 style={styles.descTitle}>About Event</h3>
            <p style={styles.descText}>
              Join us for an immersive experience learning about the latest in technology. 
              This workshop is suitable for all levels. Certificate provided upon completion.
            </p>
          </div>
        </div>
      </div>

      {/* Floating Action Button */}
      <div style={styles.footer}>
        <button style={styles.registerBtn} onClick={() => { onRegister(event.id); navigate('/my-events'); }}>
          Register Now
        </button>
      </div>
    </div>
  );
};

export default EventDetails;
